import React from 'react';
import '../Stylesheets/Header.css';

const Header = () => {
const cartItemQuantity = '';
const cartWithQuantity = `Cart (${cartItemQuantity})`;
return (
<nav>
<ul>
<li><a href='/' style={{ fontSize: '80px' }}>Shopping</a></li>
<li><a href='/' style={{ float: 'left' }} >Products</a></li>
<li><a href='/'>{cartWithQuantity}</a></li>
</ul>
</nav>
);
}

export default Header;
